     "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTclYYJIAS5EfjGG8FdwopkB1MeFhewElWZkFfar6ogNU6kLsCqPi2W-7XmDEuort7nX3o&usqp=CAU",

  ];

  // ImageGrids({required this.imageUrls});


  @override
  Widget build(BuildContext context) {
    return Container(
      padding: EdgeInsets.symmetric(vertical: 8.0),
        child: Wrap(
          alignment: WrapAlignment.center,
          spacing: 19,
          runSpacing: 19,
          children: imageUrls.map((url) => buildImage(url)).toList(), ),

    );
  }
  Widget buildImage (String url){
    return ClipRRect(
      borderRadius: BorderRadius.circular(8),
      child: Image.network(url,
      width: 166,
      height: 160,
      fit:  BoxFit.cover,

    ),
    );
